"""
    792. 2018-8-10 19:45:38
    Given string S and a dictionary of words words, find the number of words[i] that is a subsequence of S.

    Example :
    Input:
    S = "abcde"
    words = ["a", "bb", "acd", "ace"]
    Output: 3
    Explanation: There are three words in words that are a subsequence of S: "a", "acd", "ace".
"""


class number_of_matching_subsequence:
    def numMatchingSubseq(self, S, words):
        """
        :type S:str input str
        :type words:List[str] target matching words array
        :rtype:int
        """

        matchedSet = set()
        notmatchedSet = set()

        matchCount = 0
        for matchStr in words:
            if matchStr in matchedSet:
                matchCount += 1
                continue

            if matchStr in notmatchedSet:
                continue

            indexOfmatchstr = 0
            for i in range(len(S)):
                ch = S[i]

                if ch == matchStr[indexOfmatchstr]:
                    indexOfmatchstr += 1
                    if indexOfmatchstr >= len(matchStr):
                        matchCount += 1
                        matchedSet.add(matchStr)
                        break

            if indexOfmatchstr < len(matchStr):
                notmatchedSet.add(matchStr)

        return matchCount


